text.func:
__ht__function(v) {
    if (v === 1) {
        return '可预测'; 
    }
    else if (v === 2) {
        return '鲁棒的'; 
    }
    else if (v === 3) {
        return '稳定的'; 
    }
    else if (v === 4) {
        return '反应性'; 
    }
    else if (v === 5) {
        return '超负荷'; 
    }
}

text.color.func:
__ht__function(v) {
    if (v === 1 || v === 2) {
        return 'rgb(38,210,222)'; 
    }
    else if (v === 3 || v === 4) {
        return '#FEB64D'; 
    }
    else if (v === 5) {
        return 'rgb(255,99,64)'; 
    }
}
